const AboutUs = () => {
    return ( 
        <section id="AboutUs"  className="about--section">
            <div className="about--section--img">
                <img src="./img/PurpleP.png" alt="P" />

            </div>
            <div className="hero--section--content--box about--section--box">
                <div className="hero--section--content">
                    <p className="section--title">About</p>
                    <h1 className="skills--section--heading">About Us </h1>
                    <p className="hero--section--description">UEA Parking Management System is dedicated to revolutionizing parking experiences. We leverage cutting-edge technology to provide seamless, efficient, and user-friendly parking solutions. Our commitment to excellence ensures optimal utilization of parking spaces, enhancing convenience for all. Join us as we redefine parking, one space at a time.</p>
                    <p className="hero--section--description">Experience the future of parking with UEA. Our system prioritizes efficiency, user convenience, and optimal space utilization.</p>


                </div>


            </div>

        </section>
     );
}
 
export default AboutUs;
